bool is_digit_str(String s) {
  if (s.length == 0) {
    return false;
  }
  int i = 0;
  while (i < s.length) {
    String c = s.substring(i, i + 1);
    if (c.compareTo("0") < 0 || c.compareTo("9") > 0) {
    return false;
  }
    i = i + 1;
  }
  return true;
}

int parse_decimal(String s) {
  int value = 0;
  int i = 0;
  while (i < s.length) {
    String c = s.substring(i, i + 1);
    value = value * 10 + ((c).codeUnitAt(0));
    i = i + 1;
  }
  return value;
}

